import React from 'react';
import PropTypes from 'prop-types';

const Navbar = ({ title }) => {
  return <div className='navbar bg-primary'>{title}</div>;
};

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
};

Navbar.defaultProps = {
  title: 'Befitting',
};

export default Navbar;
